--
-- Name: ticks_day; Type: VIEW; Schema: public; Owner: ssafyuser
--

CREATE VIEW public.ticks_day AS
 SELECT _materialized_hypertable_2.stock_info_id,
    _materialized_hypertable_2.date,
    _materialized_hypertable_2.open_price,
    _materialized_hypertable_2.high_price,
    _materialized_hypertable_2.low_price,
    _materialized_hypertable_2.close_price,
    _materialized_hypertable_2.volume
   FROM _timescaledb_internal._materialized_hypertable_2
  WHERE (_materialized_hypertable_2.date < COALESCE(_timescaledb_internal.to_timestamp(_timescaledb_internal.cagg_watermark(2)), '-infinity'::timestamp with time zone))
UNION ALL
 SELECT "TICKS".stock_info_id,
    public.time_bucket('1 day'::interval, "TICKS".ts) AS date,
    public.first("TICKS".open_price, "TICKS".ts) AS open_price,
    max("TICKS".high_price) AS high_price,
    min("TICKS".low_price) AS low_price,
    public.last("TICKS".close_price, "TICKS".ts) AS close_price,
    sum("TICKS".volume) AS volume
   FROM public."TICKS"
  WHERE ("TICKS".ts >= COALESCE(_timescaledb_internal.to_timestamp(_timescaledb_internal.cagg_watermark(2)), '-infinity'::timestamp with time zone))
  GROUP BY "TICKS".stock_info_id, (public.time_bucket('1 day'::interval, "TICKS".ts));


ALTER TABLE public.ticks_day OWNER TO ssafyuser;

--
-- Name: STOCK_DAY; Type: VIEW; Schema: public; Owner: ssafyuser
--

CREATE VIEW public."STOCK_DAY" AS
 SELECT (row_number() OVER (ORDER BY ticks_day.stock_info_id, ticks_day.date))::integer AS stock_day_id,
    ticks_day.stock_info_id,
    (ticks_day.date)::date AS date,
    ticks_day.open_price,
    ticks_day.high_price,
    ticks_day.low_price,
    ticks_day.close_price,
    NULL::double precision AS fluctuation_rate,
    (ticks_day.volume)::integer AS volume
   FROM public.ticks_day;


