--
-- Name: ticks_month; Type: VIEW; Schema: public; Owner: ssafyuser
--

CREATE VIEW public.ticks_month AS
 SELECT _materialized_hypertable_4.stock_info_id,
    _materialized_hypertable_4.date,
    _materialized_hypertable_4.open_price,
    _materialized_hypertable_4.high_price,
    _materialized_hypertable_4.low_price,
    _materialized_hypertable_4.close_price,
    _materialized_hypertable_4.volume
   FROM _timescaledb_internal._materialized_hypertable_4
  WHERE (_materialized_hypertable_4.date < COALESCE(_timescaledb_internal.to_timestamp(_timescaledb_internal.cagg_watermark(4)), '-infinity'::timestamp with time zone))
UNION ALL
 SELECT "TICKS".stock_info_id,
    public.time_bucket('1 mon'::interval, "TICKS".ts) AS date,
    public.first("TICKS".open_price, "TICKS".ts) AS open_price,
    max("TICKS".high_price) AS high_price,
    min("TICKS".low_price) AS low_price,
    public.last("TICKS".close_price, "TICKS".ts) AS close_price,
    sum("TICKS".volume) AS volume
   FROM public."TICKS"
  WHERE ("TICKS".ts >= COALESCE(_timescaledb_internal.to_timestamp(_timescaledb_internal.cagg_watermark(4)), '-infinity'::timestamp with time zone))
  GROUP BY "TICKS".stock_info_id, (public.time_bucket('1 mon'::interval, "TICKS".ts));


ALTER TABLE public.ticks_month OWNER TO ssafyuser;

--
-- Name: STOCK_MONTH; Type: VIEW; Schema: public; Owner: ssafyuser
--

CREATE VIEW public."STOCK_MONTH" AS
 SELECT (row_number() OVER (ORDER BY ticks_month.stock_info_id, ticks_month.date))::integer AS stock_mon_id,
    ticks_month.stock_info_id,
    (((EXTRACT(year FROM ticks_month.date))::integer * 100) + (EXTRACT(month FROM ticks_month.date))::integer) AS date,
    ticks_month.open_price,
    ticks_month.high_price,
    ticks_month.low_price,
    ticks_month.close_price,
    NULL::double precision AS fluctuation_rate,
    (ticks_month.volume)::integer AS volume
   FROM public.ticks_month;


ALTER TABLE public."STOCK_MONTH" OWNER TO ssafyuser;

--
-- Name: ticks_week; Type: VIEW; Schema: public; Owner: ssafyuser
--

CREATE VIEW public.ticks_week AS
 SELECT _materialized_hypertable_3.stock_info_id,
    _materialized_hypertable_3.date,
    _materialized_hypertable_3.open_price,
    _materialized_hypertable_3.high_price,
    _materialized_hypertable_3.low_price,
    _materialized_hypertable_3.close_price,
    _materialized_hypertable_3.volume
   FROM _timescaledb_internal._materialized_hypertable_3
  WHERE (_materialized_hypertable_3.date < COALESCE(_timescaledb_internal.to_timestamp(_timescaledb_internal.cagg_watermark(3)), '-infinity'::timestamp with time zone))
UNION ALL
 SELECT "TICKS".stock_info_id,
    public.time_bucket('7 days'::interval, "TICKS".ts) AS date,
    public.first("TICKS".open_price, "TICKS".ts) AS open_price,
    max("TICKS".high_price) AS high_price,
    min("TICKS".low_price) AS low_price,
    public.last("TICKS".close_price, "TICKS".ts) AS close_price,
    sum("TICKS".volume) AS volume
   FROM public."TICKS"
  WHERE ("TICKS".ts >= COALESCE(_timescaledb_internal.to_timestamp(_timescaledb_internal.cagg_watermark(3)), '-infinity'::timestamp with time zone))
  GROUP BY "TICKS".stock_info_id, (public.time_bucket('7 days'::interval, "TICKS".ts));


ALTER TABLE public.ticks_week OWNER TO ssafyuser;

--
-- Name: STOCK_WEEK; Type: VIEW; Schema: public; Owner: ssafyuser
--

CREATE VIEW public."STOCK_WEEK" AS
 SELECT (row_number() OVER (ORDER BY ticks_week.stock_info_id, ticks_week.date))::integer AS stock_week_id,
    ticks_week.stock_info_id,
    (EXTRACT(epoch FROM ticks_week.date))::integer AS date,
    ticks_week.open_price,
    ticks_week.high_price,
    ticks_week.low_price,
    ticks_week.close_price,
    NULL::double precision AS fluctuation_rate,
    (ticks_week.volume)::integer AS volume
   FROM public.ticks_week;


