1	더블탑	**더블 탑**은 가격이 비슷한 두 꼭대기를 만들고 내려가는 **하락 반전 신호**예요. ##**목선(Neckline)을 아래로 뚫으면** 더 하락할 수 있으니  **매도 시점**으로 봐요. ##목표 가격은 꼭대기와 목선 사이 거리만큼 더 떨어질 수 있어요.	https://i.postimg.cc/cCqGGJgJ/double-top.png
2	더블바텀	**더블 바텀**은 가격이 비슷한 두 바닥을 만든 뒤 올라가는 **상승 반전 신호**예요. ##**목선(Neckline)을 위로 돌파**하면 더 상승할 수 있으니  @@매수 시점@@으로 봐요. ##목표 가격은 바닥과 목선 사이 거리만큼 **위로 상승**할 수 있어요.	https://i.postimg.cc/s2XrpqC3/double-bottom.png
3	헤드 & 숄더	**헤드 앤 숄더**는 가운데가 가장 높은 **세 개의 꼭대기**(어깨-머리-어깨) 모양으로 나타나는 **하락 반전 신호**예요. ##**목선(Neckline)을 아래로 돌파**하면 더 하락할 수 있으니  **매도 시점**으로 봐요. ##목표 가격은 머리와 목선 사이 거리만큼 **아래로 하락**할 수 있어요.	https://i.postimg.cc/sXGCLW28/head-shoulder.png
4	역 헤드 & 숄더	**역 헤드 앤 숄더**는 바닥에 생기는 **상승 반전 신호**로, 가운데가 가장 낮은 **세 개의 바닥**(어깨-머리-어깨) 모양이에요. ##**목선(Neckline)을 위로 돌파**하면 더 상승할 수 있으니  @@매수 시점@@으로 봐요. ##목표 가격은 머리와 목선 사이 거리만큼 **위로 상승**할 수 있어요.	https://i.postimg.cc/brQcyjk9/Inverse-haed-shoulder.png
5	상승 삼각	**상승 삼각형**은 윗변이 평평하고 아랫변이 점점 올라가는 **지속형 상승 패턴**이에요. ##**윗변(저항선)을 돌파**하면 더 상승할 수 있으니 @@매수 시점@@으로 봐요. ##목표 가격은 삼각형의 높이만큼 **위로 상승**할 수 있어요.	https://i.postimg.cc/J4LCTGC6/up-triangle.png
6	하락 삼각	**하락 삼각형**은 아랫변이 평평하고 윗변이 점점 내려가는 **지속형 하락 패턴**이에요. ##**아랫변(지지선)을 돌파**하면 더 하락할 수 있으니  **매도 시점**으로 봐요. ##목표 가격은 삼각형의 높이만큼 **아래로 하락**할 수 있어요.	https://i.postimg.cc/Xvz0xLnd/down-triangle.png
7	대칭 삼각	**대칭 삼각형**은 윗변(저항선)과 아랫변(지지선)이 서로 좁혀지는 **수렴 패턴**이에요. ##**위/아래 어느 쪽이든 돌파**하면 그 방향으로 강하게 움직일 가능성이 커요. ##목표 가격은 삼각형의 가장 넓은 높이만큼 **돌파 방향**으로 움직일 수 있어요.	https://i.postimg.cc/bYbjH1WS/Sym-triangle.png
